import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Title(props){
    return (
        <h1>
            {props.value}
        </h1>
    );
}

function Task(props){
    return(
      <h3>
          {props.value}
      </h3>  
    );
}

function Assignee(props){
    return(
        <h3>
            {props.value}
        </h3>
    );
}

class TaskCard extends React.Component{
    constructor(props){
        super(props);
        this.state ={
            title:"Order Lunch",
            task:"Order fries",
            assignee:"John Doe"
        }
    }

    renderTitle(title){
        return(
            <Title
                value = {Title}
            />
        );
    }

    renderTask(task){
        return(
            <Task
                value = {Task}
            />
        );
    }

    renderAssignee(assignee){
        return(
            <h1>
                {assignee}
            </h1>
        );
    }

    render(){
        return(
            <div class = "taskcard">
                <div class = "title">
                        {this.renderTitle(this.state.title)}
                    </div>
                <div class = "task-footer">

                    <div class = "task">
                        {this.renderTask(this.state.task)}
                    </div>
                    <div class = "assignee">
                        {this.renderAssignee(this.state.assignee)}
                    </div>
                </div>
            </div>
        );
    }
}
  // ========================================

  ReactDOM.render(
    <TaskCard />,
    document.getElementById('root')
  );
